import React,{useState} from 'react';
import CarCard from './CarCard';

import './CarList.css';


function CarList({ cars, onEdit, onDelete }) {
  const [show,setShow]=useState(false);

  const changeShow=()=>{
    setShow(false);
  }

  if (!cars || cars.length === 0) {
    return (
      <div className="car-list-empty">
        <p>No cars available. Add some cars to get started!</p>
      </div>
    );
  }

  return (
    <div className="car-list">
      {cars.map((car) => (
        <CarCard 
          key={car.id} 
          car={car}
          // onEdit={() => onEdit(car.id,{brand:car.brand,model:car.model,year:car.year,price:car.price,description:car.description,image:car.image})}
          onEdit={()=>{changeShow(!show)}}
         
          onDelete={() => onDelete(car.id)}
        />
      ))}
    </div>
  );
}

export default CarList;
